//Create a function to return the best word to play (the first in the wordsToSearch array)
function getBestWord(){
    //If there is only one possible word remaining, then return this
    if (wordsToSearch.length === 1) return wordsToSearch[0];
    //If this is the second guess, return the best word that doesn't contain any of the same
    //letters as the previous best word
    if (guess === 2 || guess === 3){
        //Set const for alternativeBestWord from array
        const alternativeBestWord = alternativeWordsArray[0];
        //If any of the remaining possible words contain letters in the best alternative word,
        //then return the alternative word, otherwise the normal best word will be returned.
        for (const word of wordsToSearch) {
            const letterArray = word.split('');
            for (i=0;i<5;i++){
                if (letterArray.includes(alternativeBestWord[i])){
                    return alternativeBestWord;
                }
            }
        }
    }
    return wordsToSearch[0];
}

//Create a function to remove all the words that contain a certain letter (GREY)
function greyLetterUpdate(letter, wordsArray){
    wordsArray = wordsArray.filter(word =>{
        const wordArray = word.split('');
        return (!wordArray.includes(letter)); 
    })
    return wordsArray;
}

//Create a function to remove all the words that don't contain a letter, or
//do contain it in a particular place (YELLOW)
function yellowLetterUpdate(letter, index, wordsArray){
    wordsArray = wordsArray.filter(word =>{
        const wordArray = word.split('');
        if (wordArray.includes(letter)){ //Search to see if the letter is in the word
            if (!(wordArray[index] === letter)){ //Check to see if letter is at same index.
                return true; 
            }
        }
        return false
    })
    return wordsArray;
}

//Create a function to remove all the words that don't contain a letter in a certain place (GREEN)
function greenLetterUpdate(letter, index, wordsArray){
    wordsArray = wordsArray.filter(word =>{
        const wordArray = word.split('');
        return (wordArray[index] === letter);
    })
    return wordsArray;
}

//Create an function that receives a string of 5 numbers 0-2 to
//represent the results of the last word. It calls the relevant update
//functions to filter down wordsToSearch
function updateWordsWithResults(results, wordsArray){
    results = results.split('')
    //Use for loop so index of currentBestWord and results can be matched
    for(i=0;i<5;i++){
        // console.log(results[i]);
        switch(parseInt(results[i])){
            case 0: 
                wordsArray = greyLetterUpdate(currentBestWord[i], wordsArray);
                break;
            case 1:
                wordsArray = yellowLetterUpdate(currentBestWord[i], i, wordsArray);
                break;
            case 2:
                wordsArray = greenLetterUpdate(currentBestWord[i], i, wordsArray);
                break;
        }
        
    }
    return wordsArray;
}

//Create a function that receives a word array, calculates the frequency of each letter
//and returns a re-ordered array based on this
function getWordsOrderedByFrequency(wordArray){
    //Create array to store the letter frequency count
    let letterFrequencies = new Array(26);
    //Iterate through all the words in wordArray and update the letter frequency array
    //with each one
    for (let word of wordArray){
        letterFrequencies = updateLetterFrequency(word, letterFrequencies)
    }
    //Re-order wordArray using letter frequency array and return
    return wordArray.sort((a,b) => {
        calculateLFScore(b,letterFrequencies) - calculateLFScore(a,letterFrequencies)
    });
}

//Create a function that takes a word and letter freqeuncy array and updates the array
// depending on the letters in the word
function updateLetterFrequency(word, letterFrequencyArray){
    //Turn the string into an array
    const array = word.split('');
    //For each letter in the word, update the relevant index of letterFrequencies
    array.forEach(char => {
        //Call getArrayIndex to get the index for the letter
        const index = getArrayIndex(char);
        //Increase the relevant index of letterFrequencies by 1
        letterFrequencyArray[index] += 1;
    })
    return letterFrequencyArray;
}

//Create a fucntions that receives a word and returns its letter frequency score
//ALF is calculated by adding the frequencies of all the unique letters, as we want 
//to prioritise letters with more unique letters to eliminate more possible letters each round.
function calculateLFScore(word, letterFrequencyArray){
        //Convert word into an array
        letters = word.split('');
        //Sort into alphabetical order
        letters = letters.sort();
        //Create a variable to store the LFScore to return
        let lfScore = 0;
        //Create a varaible to store the last letter to check for duplicates during iteration
        let lastLetter; 
        //Iterate through letters and add LF score of letter to lfScore if it is not a duplicate
        letters.forEach(letter =>{
            if (letter != lastLetter){
                const index = getArrayIndex(letter);
                lfScore += parseInt(letter => {letterFrequencyArray[index]});
            }
            lastLetter = letter;
        })
        return lfScore;
}

//Create a function that receives a lower case character and returns the correct
//array index for that char in the letterFrequencies array. (a = 0, b = 1 etc)
function getArrayIndex(char){
    //Get the unicode for the character
    let code = char.charCodeAt(0);
    //Return the code - 97 (unicode for 'a'), which will return the correct index (0-25)
    return code - 97
}

//----------------DOM Manipulation--------------//

//Create a function to produce a new row of letters and fill it with best word
function createNewRow(){
    //Create div of class 'wordRow' and add 'currentRow' class
    const row = document.createElement('div');
    row.classList.add('wordRow', 'currentRow');
    //Get array of letters in currentBestWord
    const bestWordArray = currentBestWord.split('');
    //Create five 'letterBox' divs and fill with letters of currentBestWord
    for (i=0;i<5;i++){
        const box = document.createElement('div');
        box.classList.add('letterBox');
        box.innerText = bestWordArray[i].toUpperCase();
        box.style.background = wordleWhite;
        box.style.color = 'black';
        box.addEventListener('click', boxClick)
        row.appendChild(box);
    }
    container.appendChild(row);
}

function createButton(){
    //Create new button element
    const button = document.createElement('button');
    button.innerText = "Submit Results";
    button.disabled = true; //Disable the button so it cannot be pressed to start with
    button.addEventListener('click', resultsSubmitted);
    document.querySelector('body').appendChild(button);
}

//Create a function that enables the submit button if all of the current 
//boxes have had options entered
function enableButtonIfAllBoxesClicked(){
    //Get a nodelist of letterBoxes in currentRow
    const currentLetterBoxes = getCurrentRowBoxes();
    //Create a bool to record whether button should be disabled and set to false
    let disabled = false;
    //Iterate through nodes and set enable to false and break if any have not been clicked 
    for (box of currentLetterBoxes){
        const tc = box.style.color;
        if (tc != 'white'){
            disabled = true;
            break;
        }
    }
    //Update the button with the 'disabled' bool.
    disableButton(disabled);
}

//Create a function that returns a string of the results based on the 
//user input
function getResultsFromInput(){
    //Get NodeList of all current boxes
    boxes = getCurrentRowBoxes();
    //Create variable to store results string
    let results = '';
    //Iterate through boxes and update results based on background colour
    boxes.forEach(box => {
        //Get background colour of box
        const bc = box.style.background;
        switch (bc){
            case wordleGrey:
                results += '0'; // 0 means the letter was grey
                break;
            case wordleYellow:
                results += '1'; // 1 means the letter was yellow
                break;
            case wordleGreen:
                results += '2'; // 2 means the letter was green
                break;
        }
    })
    return results;
}

//Create a function to return the currentRow
function getCurrentRow(){
    return document.querySelector('.currentRow');
}

//Create a function that returns a NodeList of the boxes in the currentRow.
function getCurrentRowBoxes(){
    return document.querySelectorAll('.currentRow > .letterBox');
}

//Create a function to return the words-remaining <p>
function getWordsLeftPara(){
    return document.querySelector('#words-left');
}

//Create a function to disable/able the button
function disableButton(bool){
    const button = document.querySelector('button');
    button.disabled = bool;
}

//-------------------Callbacks-------------------//

//Create a function to change the background colour of a letterbox when it is clicked.
function boxClick(){
    //Cycle through the background colours
    const bc = this.style.background;
    if (bc === wordleGrey){ 
        this.style.background = wordleYellow;
    }
    else if (bc === wordleYellow){
        this.style.background = wordleGreen;
    }
    else{ //If it is white or green, it will set to grey.
        this.style.background = wordleGrey;
    }
    //If not already, set text colour to white.
    this.style.color = 'white';
    //Check to see if submit button should be enabled.
    enableButtonIfAllBoxesClicked();
}

//Create a function that reads and handles the results when the button is pressed.
function resultsSubmitted(){
    //Increase guess counter by 1
    guess += 1;
    //Get the results inputted by the user
    let results = getResultsFromInput();
    //Pass the results to updateWordsWithResults()
    wordsToSearch = updateWordsWithResults(results, wordsToSearch);
    //Filter down alternativeWordArray to remove all the letters used so far
    alternativeWordsArray = updateWordsWithResults('00000', alternativeWordsArray);
    //Get new best word
    currentBestWord = getBestWord();
    //Remove .currentRow class from the current row
    getCurrentRow().classList.remove('currentRow');
    //Add new row
    createNewRow();
    //Disable button
    disableButton(true);
    //Update 'words-left' paragraph
    const para = getWordsLeftPara();
    if (wordsToSearch.length <= 20){
        let words = `The ${wordsToSearch.length} remaining possible words are: `;
        wordsToSearch.forEach(word => words += `${word.toUpperCase()}   `)
        para.innerText = words;
    }
    else{
        para.innerText = `There are ${wordsToSearch.length} possible words left`;
    }
}